import { Divider, Grid, Typography } from "@mui/material";
import SideBar from "./SideBar/SideBar";
import AddTwist from "./Twist/AddTwist";
import ListTwist from "./Twist/ListTwist";
const Home = ({ disconnect }) => {
  return (
    <Grid container direction="row" justifyContent="space-around" mt={3}>
      <Grid item xs={1}>
        <SideBar disconnect={disconnect}></SideBar>
      </Grid>
      <Grid container item direction="row" xs={9}>
        <AddTwist></AddTwist>
        <Divider sx={{ borderBottomWidth: "3px" }} />
        <ListTwist></ListTwist>
      </Grid>
    </Grid>
  );
};

export default Home;
